import { ApplicationNode } from '../../application.node';
import { Frame } from '../../models/application';
import { ApplicationNodeType } from './application-node-type';
/**
 * The Frames node type. Allows an application node to contain a list of frames
 * A list of frames that each contain a pose and a frame name
 */
export interface FramesNode extends ApplicationNode {
    type: ApplicationNodeType.FRAMES;
    version: string;
    framesList: Array<Frame>;
}
